import React, { useState }  from 'react';




const Listnote = () =>{

    const [value, setValue] = useState({
        title : '',
        para : ''
    }
    )

    const inputVal = (e) =>{
        const value = e.target.value;
        const name = e.target.name;

        setValue((olddata)=>{
            return {...olddata, [value] : name}
        })
        
    }


    return(
        <div>
            <input placeholder= "title" onChange = {inputVal} 
            value = {value.title} name = "title"/><br/>
            <textarea rows="" cols="" onChange = {inputVal} 
            value = {value.para} name="para" /><br/>
            <button >Add</button>
        </div>
    )
}


export default Listnote ;
